import react,{useState} from 'react'
import {useEffect} from 'react'
import imgdic from '../Data/Imgedata'


const ImgeShow=()=>{

    const [index,setindex]=useState(0)

    useEffect(()=>{
        return (()=>{
            let new_index=(index+1)%imgdic.length;
            setTimeout(()=>{
                setindex(new_index);
            },3000)
        })

    },index)
  

    return(
    <div className="imgshow_div">
        {
            imgdic.map((img,index)=>{

                const {id,link}=img

                
                
                return (
                <img src={link} key={id} className='imgshow nextclass' alt="hi"></img>
                 )

            })
        }
    </div>
    )
}

export default ImgeShow;
